import request from "@/api";

// 测试方法
export function test(data) {
    return request({
        url: '/test',
        method: 'get',
        data: data
    })
}

// 登录
export function login(data) {
    return request({
        url: '/login',
        method: 'post',
        data: data
    })
}

// 登出
export function logout() {
    return request({
        url: '/logout',
        method: 'get'
    })
}

// 前往main
export function toMain() {
    return request({
        url: '/main',
        method: 'get'
    })
}
